	def initialize_and_get(self, degree, words, commands):
		bt = BTree(degree)
		for word in words:
			bt.insert(word)
		for command in commands:
			action, word = command.split()
			if action == "delete":
				bt.delete(word)
			elif action == "insert":
				bt.insert(word)
